import { Link } from 'react-router-dom';

import './App.css';
function App() {
  return (
    <div className="App">
      <nav>
        <h1>Loan Calculator</h1>
        <a href="/">Home</a>
        <a href="/about">About</a>
        <a href="/contact">Contact</a>
        <a href="/contact">Contact</a>
      </nav>


    </div>
  );
}

export default App;
